    false,nt"url": null,nt"notes": "This report is a summary of the research
    conducted on Baca National Wildlife Refuge that was focused on sampling fungal community
    diversity of a maternity roost of resident big brown bats located in an abandon
    outbuilding. Bats were captured by use of a mist net, and fungal spores were collected
    from the wing membranes and dorsal and ventral fur.  The studies results were noteworthy,
    as they demonstrated for the first time that fungi belonging to the genus Pseudogymnoascus
    were present on bats in Colorado.  Figures include the sequence alignment of fungal
    isolates and fungal morphology and stain photos.  Analysis of DNA sequencing, monitoring
    recommendations, and species conservation recommendations for the refuge are included.",nt"owner_org":
